let pixbuf = GdkPixbuf.from_xpm_data xpm

let window ~name ~version () =
  let window = GWindow.window
    ~kind:`POPUP
    ~type_hint:`MENU
    ~icon:Icons.oe
    ~resizable:false
    ~modal:true
    ~position:`CENTER
    ~border_width:1
    ~title:("About " ^ name)
    ~show:false
    ()
  in
  let ebox = GBin.event_box ~border_width:0 ~packing:window#add () in
  ebox#misc#set_property "visible-window" (`BOOL true);
  let vbox = GPack.vbox ~packing:ebox#add () in
  let _ = GMisc.image ~pixbuf ~packing:vbox#add () in

  let vbox = GPack.vbox ~packing:vbox#add () in
  let align = GBin.alignment ~xscale:0.97 ~packing:vbox#pack ~show:false () in
  let _ = GMisc.separator `HORIZONTAL ~packing:align#add () in
  let ehbox = GBin.event_box ~border_width:0 ~packing:vbox#pack ~show:false () in
  ehbox#misc#set_property "visible-window" (`BOOL true);
  ehbox#misc#modify_bg [`NORMAL, `NAME "#ffffff"];
  let hbox = GPack.hbox ~spacing:3 ~border_width:2 ~packing:ehbox#add () in
  let spinner = GMisc.image ~file:(Common.application_pixmaps // "spinner_16.gif") ~packing:hbox#pack () in
  let label = GMisc.label ~text:"Checking for updates..." ~height:16 ~packing:hbox#pack () in
  label#misc#modify_fg [`NORMAL, `NAME "#808080"];
  label#misc#modify_font_by_name "Sans 7";

  ebox#misc#modify_bg [`NORMAL, `NAME "#ffffff"];
  window#misc#modify_bg [`NORMAL, `NAME "#c9c9c9"];
  window#set_skip_taskbar_hint true;
  window#set_skip_pager_hint true;

  let check_for_updates () =
    try
      if try int_of_string (List.assoc "debug" Common.application_param) >= 1 with Not_found -> false then (raise Exit);
      begin
        match Check_for_updates.check version () with
          | Some ver -> kprintf label#set_text "A new version of %s is available (%s)" name ver;
          | None -> label#set_text "There are no updates available."
      end;
      spinner#set_stock `DIALOG_INFO;
      spinner#set_icon_size `MENU;
    with ex -> begin
      kprintf label#set_text "Unable to contact server for updates (%s)." (Printexc.to_string ex);
      spinner#set_pixbuf Icons.warning_14;
      spinner#misc#hide()
    end
  in

  ignore (window#misc#connect#show ~callback:begin fun () ->
    let count = ref 0 in
    ignore (GMain.Timeout.add ~ms:600 ~callback:begin fun () ->
      if !count = 1 then begin
        align#misc#show();
        ehbox#misc#show();
      end else if !count = 2 then (check_for_updates());
      incr count;
      true
    end)
  end);

  ignore (ebox#event#connect#button_press ~callback:begin fun ev ->
    window#destroy();
    true
  end);
  ignore (window#event#connect#key_press ~callback:begin fun ev ->
    window#destroy();
    true
  end);
  window

